import styles from './Artificial.module.scss';

const Page = ({}) => {
    return (
        <>
            <Nav />
            <div className='ag-hero'>
                <Container>
                    <div className='ag-header'>
                        <h1>
                            welcome to greenscapes <span>artifical</span> lawn
                            specialists
                        </h1>
                    </div>
                </Container>
            </div>
        </>
    );
};

const Nav = ({}) => (
    <div style={{ height: '100px' }}>
        <Container>
            <div
                style={{
                    height: '100px',
                    display: 'flex',
                    alignItems: 'center',
                }}>
                <img src='/greenscapes-artificial-grass-logo.svg' />
            </div>
        </Container>
    </div>
);

const Container = ({ children }) => (
    <div className='ag-container'>{children}</div>
);

export default Page;
